CREATE TABLE `Mapping` (
  `id_mapping` int NOT NULL AUTO_INCREMENT COMMENT 'identificador',
  `type_date` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT 'tipo de dato: I: input , O: output',
  `type_replace` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT 'tipo de reemplazo : E: estático C: cambiante',
  `api_ewp` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT 'nombre del api EWP',
  `clave_ewp` text CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT 'clave o campo EWP',
  `valor_ewp` text CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci COMMENT 'valor de la clave EWP',
  `valor_position_ewp` char(1) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci DEFAULT NULL COMMENT 'posición cuando el valor EWP esta concatenado con caracter',
  `split_ewp` char(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci DEFAULT NULL COMMENT 'el caracter que se utiliza en la concatenación',
  `clave_comv` text CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT 'clave o campo Comviva',
  `valor_comv` text CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci COMMENT 'valor de la clave Comviva',
  `is_compare` int NOT NULL COMMENT '0: no comparar claves , 1: comparar claves',
  `type_compare` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci NOT NULL COMMENT '"directa": comparación de uno a uno , "arreglos": buscar match entre arreglos',
  `parent_id_mapping` int DEFAULT NULL COMMENT 'id hijo de id_mapping cuando exista comparación tipo arreglos',
  `is_identifier` int DEFAULT NULL COMMENT '1: indica que claves se requieren para realizar el match entre arreglos',
  `is_saved` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `sel_value` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  `id_json_api` int DEFAULT NULL,
  `table_save` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_spanish_ci DEFAULT NULL,
  PRIMARY KEY (`id_mapping`),
  KEY `idx_mapping_api_ewp` (`api_ewp`),
  KEY `idx_mapping_id_mapping` (`id_mapping`),
  KEY `idx_mapping_parent_id` (`parent_id_mapping`),
  KEY `idx_mapping_id_json_api` (`id_json_api`),
  KEY `idx_mapping_api_ewp_id_json_api` (`api_ewp`,`id_json_api`),
  KEY `idx_mapping_api_ewp_id_mapping` (`api_ewp`,`id_mapping`)
) ENGINE=InnoDB AUTO_INCREMENT=868 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_spanish_ci


